(67,1,"2020-09-20 17:59:48","2020-09-20 17:59:48","<!-- wp:paragraph -->\n<p>Thank you for taking the time out  to come and view my portfolio. I hope that you find my work appealing and creative.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> I am a US Dept. of Labor Certified Software Developer with experience developing, testing, and implementing code through training and independent study.<br>I have gained experience from attending a Java development apprenticeship program through Grand Circus. After spending a year with General Electric as a front-end developer, I decided to take that experience with development and design and apply it to my career in becoming an Android developer. Some languages that I have gained a firm grasp on in my career are as follows: Adobe Suite, HTML(5), CSS(3), XHTML, JavaScript, JQuery, Angular JS, Node JS, Java, and SQL. With these tools, I have gained a strong footing in the web development field and plan on expanding my tools with each opportunity.</p>\n<!-- /wp:paragraph -->","Welcome...","","publish","open","open","","welcome","","","2020-09-20 17:59:48","2020-09-20 17:59:48","",0,"http://portfoliowebsite.local/?p=67",0,"post","",0),
