(79,1,"2020-09-20 18:43:55","2020-09-20 18:43:55","<h1>HTML FOUNDATION</h1>		\n										<img width=\"488\" height=\"650\" src=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-488x650.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-488x650.jpg 488w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-225x300.jpg 225w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-768x1024.jpg 768w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-1152x1536.jpg 1152w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-1536x2048.jpg 1536w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-465x620.jpg 465w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-750x1000.jpg 750w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-338x450.jpg 338w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-scaled.jpg 1921w\" sizes=\"(max-width: 488px) 100vw, 488px\" />											\n		<p>HTML is the foundation of web development. Being introduced to HTML when I first attended Grand Circus Coding Boot Camp in Detroit, MI. With this powerful tool I have been able to construct beautiful applications and service many clients\' requests. Integrating this tool with CSS and JavaScript has allowed me to create powerful web applications that have progressed my career in web development. </p>		\n			<h2>HTML PROJECTS</h2>		\n										<img width=\"587\" height=\"1024\" src=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/Screen-Shot-2018-10-11-at-7.35.01-PM-1-587x1024.png\" alt=\"\" loading=\"lazy\" srcset=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/Screen-Shot-2018-10-11-at-7.35.01-PM-1-587x1024.png 587w, http://portfoliowebsite.local/wp