(100,1,"2020-09-21 01:40:42","2020-09-21 01:40:42","<h2>ABOUT</h2>		\n										<img width=\"988\" height=\"1024\" src=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-988x1024.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-988x1024.jpg 988w, http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-290x300.jpg 290w, http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-768x796.jpg 768w, http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-598x620.jpg 598w, http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-965x1000.jpg 965w, http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-600x622.jpg 600w, http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-400x414.jpg 400w, http://portfoliowebsite.local/wp-content/uploads/2020/09/26962001_174997403259675_8239412582456453668_o-e1600651761493.jpg 500w\" sizes=\"(max-width: 988px) 100vw, 988px\" />											\n		<p>Â Current Positon:</p><p><strong>Information Technology Application Testing Intern</strong></p><p>I am a US Dept. of Labor Certified Software Developer with experience developing, testing and implementing code through training and independent study. I have gained experience from attending a Java development apprenticeship program through Grand Circus. After spending a year with General Electric as a front-end developer, I decided to take that experience with development and design and apply it to my career in becoming an Android developer. Some languages that I have gained a firm grasp on in my career are as follows: Adobe Suite, HTML(5), CSS(3), XHTML, JavaScript, JQuery, Angular JS, Node JS, Java, and SQL. With these tools, I have gained a strong footing in the web development field and plan on expanding my tools with each opportunity.</p>","About","","inherit","closed","closed","","30-revision-v1","","","2020-09-21 01:40:42","2020-09-21 01:40:42","",30,"http://portfoliowebsite.local/30-revision-v1/",0,"revision","",0),
