(103,1,"2020-09-21 02:12:04","2020-09-21 02:12:04","<p>CSS is a unique language that allows for powerful and unique customizations. During my time with GE Digital I was able to master my vanilla css skills. Adjusting screens for mobile, tablet, desktop, and TV. Using this language is important when providing clients with innovative designs. I have plans to dive deeper into this language potentially creating designs for stream overlays and android applications.</p>","CSS","","inherit","closed","closed","","64-revision-v1","","","2020-09-21 02:12:04","2020-09-21 02:12:04","",64,"http://portfoliowebsite.local/64-revision-v1/",0,"revision","",0),
(104,1,"2020-09-21 02:14:33","2020-09-21 02:14:33","<img width=\"488\" height=\"650\" src=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-488x650.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-488x650.jpg 488w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-225x300.jpg 225w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-768x1024.jpg 768w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-1152x1536.jpg 1152w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-1536x2048.jpg 1536w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-465x620.jpg 465w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-750x1000.jpg 750w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-338x450.jpg 338w, http://portfoliowebsite.local/wp-content/uploads/2020/09/pexels-ola-dapo-3345882-scaled.jpg 1921w\" sizes=\"(max-width: 488px) 100vw, 488px\" />											\n		<p>Hypertext Markup language is the foundation of web development. Being introduced to HTML when I first attended Grand Circus Coding Boot Camp in Detroit, MI. With this powerful tool I have been able to construct beautiful applications and service many clients\' requests. Integrating this tool with CSS and JavaScript has allowed me to create powerful web applications that have progressed my career in web development. </p>		\n			<h2>HTML PROJECTS</h2>		\n										<img width=\"587\" height=\"1024\" src=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/Screen-Shot-2018-10-11-at-7.35.01-PM-1-587x1024.png\" alt=\"\" loading=\"lazy\" srcset=\"http://portfoliowebsite.local/wp-content/uploads/2020/09/Screen-Shot-2018-10-11-at-7.35.01-PM-1-587x1024.png 587w, http://portfoliowebsite.local/wp-content/uploads